import React from 'react'

const carouselImage = (props) => {
  return (
    <div className="gallery-right col-xs-12 col-sm-12 col-md-12 col-lg-8">
      <img src={props.image} alt="" className="img-gallery" />
    </div>
  )
}

export default carouselImage;
